public void fusionOfflineFailFastMultipleEvents() {
    UnicastSubject<Integer> ap = UnicastSubject.create(false);
    ap.onNext(1);
    ap.onNext(2);
    ap.onNext(3);
    ap.onComplete();
    TestObserverEx<Integer> to = new TestObserverEx<Integer>(QueueFuseable.ANY);
    ap.subscribe(to);

    to
            .assertValueCount(3)
            .assertComplete();
}

